    const removeCarHandler = (car) => {}

    const carsContext = {
        cars: carsState,
        addCar: addCarHandler,
        updateCar: updateCarHandler,
        removeCar: removeCarHandler
    }

    return <CarsContext.Provider value={carsContext}>
        {props.children}
    </CarsContext.Provider>
}

export default CarsProvider;
